import {
  FormControl,
  Button,
  FormGroup,
  Navbar,
  NavItem,
  Container,
  Image,
  Nav,
} from "react-bootstrap";
import classes from "./NavigBar.module.css";
function NavigBar() {
  return (
    <div>
        <Navbar bg='light'>
            <Nav>
            <Button className={classes.bb}>Hit me</Button>
            <Navbar.Brand className='nb'><Image src='brand.svg'/></Navbar.Brand>
            </Nav>

        </Navbar>


    </div>
  );
}
export default NavigBar;
